package cn.com.evo.cms.web.api.vo;import cn.com.evo.cms.domain.entity.pay.Server;/** * @Description: * @author: lu.xin * @create: 2019-01-09 10:18 PM **/public class UserProductServerApiVo {    private String serverCode;    private String serverName;    private String endTime;    public UserProductServerApiVo(Server server, String endTime) {        this.serverCode = server.getCode();        this.serverName = server.getName();        this.endTime = endTime;    }    public String getEndTime() {        return endTime;    }    public void setEndTime(String endTime) {        this.endTime = endTime;    }    public String getServerCode() {        return serverCode;    }    public void setServerCode(String serverCode) {        this.serverCode = serverCode;    }    public String getServerName() {        return serverName;    }    public void setServerName(String serverName) {        this.serverName = serverName;    }}